import React, { useEffect } from 'react'
import axios from 'axios'

const League = () => {
  useEffect(async () => {
    axios({
      method: 'POST',
      url: 'https://api-football-v1.p.rapidapi.com/v2/leagues/current/'
    })
      .then(res => {
        console.log(res)
      })
      .catch(err => {
        console.log(err)
      })
  }, [])
  return <div></div>
}

export default League
